import React from 'react';
import CartItem from './cartItem'

export default function CartList({value}){
  const {cart} = value;
  console.log(value,cart);
  return(
    <div>
      <h1>Cart List</h1>
      {cart.map(item=>{
        return <CartItem key={item.id} item={item}/>;
      })}
    </div>
  )

}
